  <h1>
   G3334 μετακινέω
  </h1>
  <h2>
   metakinéō
  </h2>
  <p>
   <em>
    (met-ak-ee-neh'-o | meh-ta-kee-NEH-oh | may-ta-kee-NAY-oh)
   </em>
  </p>
  <h3>
   Definition
  </h3>
  <p>
   from [G3326] and [G2795]; to stir to a place elsewhere, i.e., remove (figuratively); move away.
  </p>
  <ul>
   <li>
    to move from a place, to move away
   </li>
  </ul>
  <h3>
   See also
  </h3>
  <p>
   [G2795], [G3326]
  </p>
